package com.record.collection.test.serialization;

import java.io.BufferedReader;
import java.io.BufferedWriter;
import java.io.File;
import java.io.FileInputStream;
import java.io.FileOutputStream;
import java.io.FileReader;
import java.io.FileWriter;
import java.io.IOException;
import java.io.ObjectInputStream;
import java.io.ObjectOutputStream;
import java.nio.file.Files;
import java.nio.file.Paths;
import java.util.Base64;
import java.util.concurrent.TimeUnit;

import org.apache.commons.configuration2.FileBasedConfiguration;
import org.apache.commons.configuration2.PropertiesConfiguration;
import org.apache.commons.configuration2.builder.FileBasedConfigurationBuilder;
import org.apache.commons.configuration2.builder.ReloadingFileBasedConfigurationBuilder;
import org.apache.commons.configuration2.builder.fluent.Parameters;
import org.apache.commons.configuration2.convert.DefaultListDelimiterHandler;
import org.apache.commons.configuration2.ex.ConfigurationException;
import org.apache.commons.configuration2.reloading.PeriodicReloadingTrigger;
import org.apache.commons.io.FileUtils;

public class Serialize 
{	
	private static String encodeFileToBase64() throws IOException {
		 File file = new File("C:\\dev\\GoogleDocs\\UserRegPages.pdf");
		 byte [] bytes = Files.readAllBytes(file.toPath());

	     String b64 = Base64.getEncoder().encodeToString(bytes);
	     //System.out.println(b64); 
	     return b64;
	}
	
	private static void decode(String encodedPdf) {
	//	String encodedPdf = "";
		File file = new File("C:\\dev\\GoogleDocs\\CollectionRecord\\test\\out.pdf");
		try ( FileOutputStream fos = new FileOutputStream(file); ) {
	      // To be short I use a corrupted PDF string, so make sure to use a valid one if you want to preview the PDF file

	      byte[] decoder = Base64.getDecoder().decode(encodedPdf);

	      fos.write(decoder);
	      System.out.println("PDF File Saved");
	    } catch (Exception e) {
	      e.printStackTrace();
	    }
		
	}
	
	public static void main1(String[] args) throws IOException {
		String b64 = encodeFileToBase64();
		File file = new File("test.txt");
		if (!file.exists()) {
	     file.createNewFile();
	    }
		 FileWriter fw = new FileWriter(file);
		 BufferedWriter bw = new BufferedWriter(fw);
		 bw.write(b64);
		 bw.close();
		 
		 BufferedReader bf = new BufferedReader(new FileReader(new File("test.txt")));
		 String line;
		 while((line = bf.readLine()) != null) {
			 System.out.println(line);
			 decode(line);
		 }
		 
		
		//decode(b64);
	}
	
	public static void main(String [] args) {
		Parameters params = new Parameters();
		File propertiesFile = new File("C:\\dev\\PasswordUpdater\\PasswordUpdater\\deploy\\Runtime\\conf\\email.properties");
		
		ReloadingFileBasedConfigurationBuilder<FileBasedConfiguration> builder =
				    new ReloadingFileBasedConfigurationBuilder<FileBasedConfiguration>(PropertiesConfiguration.class)
				    .configure(params.fileBased()
				        .setFile(propertiesFile));
		try {
			FileBasedConfiguration config = builder.getConfiguration();
			
			PeriodicReloadingTrigger trigger = new PeriodicReloadingTrigger(builder.getReloadingController(),
				    null, 3, TimeUnit.SECONDS);
			trigger.start();
			
			System.out.println(config.getProperty("email.report.warning.columns"));
		} catch (ConfigurationException e) {
			e.printStackTrace();
		}
		 
	}
}
